import { BrowserRouter, Routes, Route } from "react-router-dom";
import Arts from ".pages/Arts";
import Update from "./pages/Update";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Arts />} />
        <Route path="/add" element={<Add />} />
        <Route path="/update" element={<Update />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
